2. Government further agrees that in all future programmes of designing curricula, the following are some of the important concerns which
need to be reflected in the educational objectives and in curricula at various levels:
(i) Scientific and technological orientation of education at all levels;
(ii) Development of the ability to use data and information for decision-making;
(iii)Development awareness and concern for protection of the environment.
AIMS AND OBJECTIVES OF SECONDARY EDUCATION
The aims and objectives secondary education are:
(iv)
(v)
(i) Instilling and promoting national unity and an understanding of social and civic responsibilities; strong love and care for others and respect
for public property, as well as an appreciation of international relations and beneficial international co-operation.
(ii) Promoting an appreciation and understanding of the cultural heritage of Uganda including its languages;
Imparting and promoting a sense of self-discipline, ethical and spiritual values and collective personal responsibility and initiative;
Enabling individuals to acquire and develop knowledge and an understanding of emerging needs of society and the economy;
Providing up-to-date and comprehensive knowledge in theoretical and practical aspects of innovative production, modern management
methods in the field of commerce and industry their application in the content of socio-economic development of Uganda;
Enabling individual to develop basic scientific. Technological, technical, agriculture and commercial skills required for self-employment;
(vii) Enabling individuals to develop persona skills of problem-solving, information gathering and interpretation, independent reading and
writing self-improvement through learning and develop of social, physical and leadership skills such as are obtained through games,
sports, societies and clubs.
(viii) Laying the foundation for further education;
(ix) Enabling the individual to apply acquired skills in solving problems of the community and to develop in him a strong sense of constructive
and beneficial belonging to that community;
(vi)
Instilling positive attitudes towards productive work and strong respect for the dignity of labour and those who engage in productive
labour activities.

